import { Component } from "react";
// import { Carousel } from "react-bootstrap";
import CarouselRow from "./CarouselRow";

class CarouselParent extends Component  {
    render () {
        return (
            <div id="rows-parent">
            <CarouselRow titleOf="Big Bang Theory" link="https://www.omdbapi.com/?apikey=c616b99fs=big%20bang%20theory"></CarouselRow>
            <CarouselRow titleOf="Matrix" link="https://www.omdbapi.com/?apikey=c616b99f s=matrix"></CarouselRow>
            <CarouselRow titleOf="Star Wars" link="https://www.omdbapi.com/?apikey=c616b99f s=star%20wars"></CarouselRow>
            </div>

        )
    }

}

export default CarouselParent;
